import React, { useState } from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import AppLivestorm from './App/AppLivestorm/AppLivestorm';
import Library from "./Library/AppLibrary/AppLibrary";
import Header from "./Header";



export default function LivestormTestHome() {

  const [hideHeader , setHideHeader] = useState(false);

    return (
    <Router>
    <Header hideHeader={hideHeader} />
        <div>
          <Switch>
              <Route exact path='/livestorm-test' component={AppLivestorm} />
              <Route path='/livestorm-test/library' component={Library} />
          </Switch>
        </div>
      </Router>
    );
}
